import * as allIcons from '../index.jsx';
import styles from './style.module.scss';

export default {
	title: 'Packages/My Jetpack/Icons',
	component: allIcons,
	parameters: {},
};

const sizes = [
	{
		label: 'small',
		value: '24',
	},
	{
		label: 'medium',
		value: '48',
	},
	{
		label: 'large',
		value: '72',
	},
];

